    render(){
        return(

            <div className="sidebar">
                <div class="nav-btn">
                    <label for="nav-check">
                    <span></span>
                    <span></span>
                    <span></span>
                    </label>
                </div>
                <input type="checkbox" id="nav-check" />
            <div className="nav-links">
            <a className="active" href="#">Home</a>
            <a href="#">Cells</a>
            <a href="#">Contact</a>
            <a href="#">About</a>
            <div className="bot">
                <a href="#">
                <FontAwesome name="facebook-square" />
                </a> 
                <a href="#">
                <FontAwesome name="instagram" />
                </a>

            </div>
            </div>

            </div>

        );
    }
};



//styles


